description:
Historien om unga amerikaner som, innan USA gick in i det forsta 
varldskriget, anmalde sig frivilligt till den franska militaren och blev 
landets forsta stridspiloter. De kampade i ett krig som inte var deras
och dessa unga, naiva och aventyrliga pojkar larde sig sanningen om 
karlek, Broderskap, Hjaltemod, mod och tolerans
